import React from 'react';
import classes from './Product.module.css';

const Product = props => (
    <div className = {classes.Product}>
        <img src='https://static.wixstatic.com/media/f99596_4d384386fa134e1a97e3e0897709bc68.png' alt="product-preview" height = '' width = ''/>
    </div>
);

export default Product;
